window.bookSummaryJSON = "<p><b>I did not fall for a hot mysterious billionaire who is actually a dragon. Nope. Not at all. Not in the least.</b></p> <p>Night nurse Andi Ngo is back to her mundanely real life - finding her stupid brother who went on the lam the moment she bailed him from jail.</p> <p>But she can’t forget her date with the Damian Blackwood, not because he’s cut like her hottest dream, not because he’s a billionaire, and not even because he’s secretly a dragon.</p> <p>For just a few delicious moments, Damian didn’t just make her feel like she mattered, like he actually cared, like she could be his.</p> <p>No, better not to think those thoughts.</p> <p>But when dangerous magic threatens her patients, Andi doesn’t know who else to turn to. One may walk free from a dragon once, but twice? Andi’s only mortal, after all.</p>"; 
